import React from "react";
import { Container, Grid, Card, CardContent, Typography } from "@mui/material";
import { motion } from "framer-motion";
import InvertColorsIcon from "@mui/icons-material/InvertColors";
import AirIcon from "@mui/icons-material/Air";
import WbSunnyIcon from "@mui/icons-material/WbSunny";
import ThermostatIcon from "@mui/icons-material/Thermostat";

function Homepage({ predictions }) {
  // Example temperature and other values
  const averageTemp = predictions[0]?.temperature || 24; // replace with actual prediction data

  return (
    <motion.div
      initial={{ opacity: 0 }}
      animate={{ opacity: 1 }}
      exit={{ opacity: 0 }}
      style={{ background: "linear-gradient(180deg, #4A90E2 0%, #1C3E72 100%)", minHeight: "100vh" }}
    >
      <Container maxWidth="lg">
        <Grid container spacing={2} style={{ height: "100vh" }}>
          {/* Left Column */}
          <Grid item xs={12} md={4}>
            <Card
              style={{
                backgroundColor: "rgba(255, 255, 255, 0.2)",
                borderRadius: "10px",
                boxShadow: "0 4px 20px rgba(0, 0, 0, 0.2)",
                height: "100%", // Take full height of the container
                display: "flex",
                flexDirection: "column",
                justifyContent: "space-between", // Spread out child elements
              }}
            >
              <CardContent>
                <Typography variant="h5" style={{ color: "white", textAlign: "center" }}>
                  Weather Overview
                </Typography>

                {/* Grid for the four weather metrics */}
                <Grid container spacing={2} style={{ flexGrow: 1, marginTop: "20px" }}>
                  {/* Temperature */}
                  <Grid item xs={6}>
                    <Card
                      style={{
                        backgroundColor: "rgba(255, 255, 255, 0.1)",
                        height: "100%", // Make each card grow to fill available space
                        textAlign: "center",
                      }}
                    >
                      <CardContent>
                        <ThermostatIcon style={{ color: "#BBDEFB", fontSize: 30 }} />
                        <Typography variant="body2" style={{ color: "white" }}>
                          Temperature
                        </Typography>
                        <Typography variant="body2" style={{ color: "white" }}>
                          {averageTemp}°C
                        </Typography>
                      </CardContent>
                    </Card>
                  </Grid>

                  {/* Humidity */}
                  <Grid item xs={6}>
                    <Card
                      style={{
                        backgroundColor: "rgba(255, 255, 255, 0.1)",
                        height: "100%",
                        textAlign: "center",
                      }}
                    >
                      <CardContent>
                        <InvertColorsIcon style={{ color: "#BBDEFB", fontSize: 30 }} />
                        <Typography variant="body2" style={{ color: "white" }}>
                          Humidity
                        </Typography>
                        <Typography variant="body2" style={{ color: "white" }}>
                          {predictions[0]?.humidity_9am}%
                        </Typography>
                      </CardContent>
                    </Card>
                  </Grid>

                  {/* Wind Speed */}
                  <Grid item xs={6}>
                    <Card
                      style={{
                        backgroundColor: "rgba(255, 255, 255, 0.1)",
                        height: "100%",
                        textAlign: "center",
                      }}
                    >
                      <CardContent>
                        <AirIcon style={{ color: "#BBDEFB", fontSize: 30 }} />
                        <Typography variant="body2" style={{ color: "white" }}>
                          Wind Speed
                        </Typography>
                        <Typography variant="body2" style={{ color: "white" }}>
                          {predictions[0]?.wind_speed_9am} km/h
                        </Typography>
                      </CardContent>
                    </Card>
                  </Grid>

                  {/* Sunshine */}
                  <Grid item xs={6}>
                    <Card
                      style={{
                        backgroundColor: "rgba(255, 255, 255, 0.1)",
                        height: "100%",
                        textAlign: "center",
                      }}
                    >
                      <CardContent>
                        <WbSunnyIcon style={{ color: "#BBDEFB", fontSize: 30 }} />
                        <Typography variant="body2" style={{ color: "white" }}>
                          Sunshine
                        </Typography>
                        <Typography variant="body2" style={{ color: "white" }}>
                          {predictions[0]?.sunshine_hours} hrs
                        </Typography>
                      </CardContent>
                    </Card>
                  </Grid>
                </Grid>
              </CardContent>
            </Card>
          </Grid>

          {/* Right Column */}
          <Grid item xs={12} md={8}>
            {/* Placeholder for additional content */}
          </Grid>
        </Grid>
      </Container>
    </motion.div>
  );
}

export default Homepage;
